import React, { useState } from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import axios from 'axios';
import './App.css';

// Sponsor Form Component
function SponsorForm() {
  const [sponsorData, setSponsorData] = useState({
    sponsor_name: '', sponsor_phone: '', farmer_name: '', amount: '', crop: '', quantity: ''
  });

  const handleChange = (e) => {
    setSponsorData(prev => ({ ...prev, [e.target.name]: e.target.value }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await axios.post('http://127.0.0.1:8000/api/sponsorship/sponsor/', sponsorData);
      console.log('Success:', response.data);
      alert('Sponsorship created!');
    } catch (error) {
      console.error('Error:', error.response?.data || error);
      alert('Failed to process request.');
    }
  };

  return (
    <div className="card p-4 mx-auto" style={{ maxWidth: '500px' }}>
      <h2 className="card-title text-center mb-4">Create Sponsorship</h2>
      <form onSubmit={handleSubmit}>
        <div className="mb-3">
          <input
            className="form-control"
            name="sponsor_name"
            placeholder="Sponsor Name"
            value={sponsorData.sponsor_name}
            onChange={handleChange}
          />
        </div>
        <div className="mb-3">
          <input
            className="form-control"
            name="sponsor_phone"
            placeholder="Sponsor Phone"
            value={sponsorData.sponsor_phone}
            onChange={handleChange}
          />
        </div>
        <div className="mb-3">
          <input
            className="form-control"
            name="farmer_name"
            placeholder="Farmer Name"
            value={sponsorData.farmer_name}
            onChange={handleChange}
          />
        </div>
        <div className="mb-3">
          <input
            className="form-control"
            name="amount"
            type="number"
            placeholder="Amount"
            value={sponsorData.amount}
            onChange={handleChange}
          />
        </div>
        <div className="mb-3">
          <input
            className="form-control"
            name="crop"
            placeholder="Crop"
            value={sponsorData.crop}
            onChange={handleChange}
          />
        </div>
        <div className="mb-3">
          <input
            className="form-control"
            name="quantity"
            type="number"
            placeholder="Quantity"
            value={sponsorData.quantity}
            onChange={handleChange}
          />
        </div>
        <button type="submit" className="btn btn-primary w-100">Create Sponsorship</button>
      </form>
    </div>
  );
}

// Produce Form Component
function ProduceForm() {
  const [produceData, setProduceData] = useState({
    farmer_name: '', farmer_phone: '', crop: '', quantity: '', price_per_kg: ''
  });

  const handleChange = (e) => {
    setProduceData(prev => ({ ...prev, [e.target.name]: e.target.value }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await axios.post('http://127.0.0.1:8000/api/marketplace/list/', produceData);
      console.log('Success:', response.data);
      alert('Produce listed!');
    } catch (error) {
      console.error('Error:', error.response?.data || error);
      alert('Failed to process request.');
    }
  };

  return (
    <div className="card p-4 mx-auto" style={{ maxWidth: '500px' }}>
      <h2 className="card-title text-center mb-4">List Produce</h2>
      <form onSubmit={handleSubmit}>
        <div className="mb-3">
          <input
            className="form-control"
            name="farmer_name"
            placeholder="Farmer Name"
            value={produceData.farmer_name}
            onChange={handleChange}
          />
        </div>
        <div className="mb-3">
          <input
            className="form-control"
            name="farmer_phone"
            placeholder="Farmer Phone"
            value={produceData.farmer_phone}
            onChange={handleChange}
          />
        </div>
        <div className="mb-3">
          <input
            className="form-control"
            name="crop"
            placeholder="Crop"
            value={produceData.crop}
            onChange={handleChange}
          />
        </div>
        <div className="mb-3">
          <input
            className="form-control"
            name="quantity"
            type="number"
            placeholder="Quantity"
            value={produceData.quantity}
            onChange={handleChange}
          />
        </div>
        <div className="mb-3">
          <input
            className="form-control"
            name="price_per_kg"
            type="number"
            placeholder="Price per kg"
            value={produceData.price_per_kg}
            onChange={handleChange}
          />
        </div>
        <button type="submit" className="btn btn-primary w-100">List Produce</button>
      </form>
    </div>
  );
}

// Buy Form Component
function BuyForm() {
  const [buyData, setBuyData] = useState({
    produce_id: '', buyer_name: '', buyer_phone: ''
  });

  const handleChange = (e) => {
    setBuyData(prev => ({ ...prev, [e.target.name]: e.target.value }));
