  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await axios.post('http://127.0.0.1:8000/api/marketplace/buy/', buyData);
      console.log('Success:', response.data);
      alert('Purchase completed!');
    } catch (error) {
      console.error('Error:', error.response?.data || error);
      alert('Failed to process request.');
    }
  };

  return (
    <div className="card p-4 mx-auto" style={{ maxWidth: '500px' }}>
      <h2 className="card-title text-center mb-4">Buy Produce</h2>
      <form onSubmit={handleSubmit}>
        <div className="mb-3">
          <input
            className="form-control"
            name="produce_id"
            type="number"
            placeholder="Produce ID"
            value={buyData.produce_id}
            onChange={handleChange}
          />
        </div>
        <div className="mb-3">
          <input
            className="form-control"
            name="buyer_name"
            placeholder="Buyer Name"
            value={buyData.buyer_name}
            onChange={handleChange}
          />
        </div>
        <div className="mb-3">
          <input
            className="form-control"
            name="buyer_phone"
            placeholder="Buyer Phone"
            value={buyData.buyer_phone}
            onChange={handleChange}
